  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `course_id` int(11) NOT NULL COMMENT '课程id',
  `teacher_id` int(11) NOT NULL COMMENT '教师id',
  `room_id` int(11) NOT NULL COMMENT '教室id',
